  \"2016-05-25T00:52:38.894665\",\n\t\"name\": \"enhanced-back-up-surveillance\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Update: On March 31, 2006 the ARTCC facilities
  in New York, Miami and Los Angeles achieved full operational status for the EBUS
  system.  This completed the deployment of EBUS to all 20 ARTCCs in the continental
  United States.The Enhanced Back-Up Surveillance (EBUS) system replaced the Direct
  Access Radar Channel (DARC) system in use at the 20 Air Route Traffic Control Centers
  (ARTCC) in the contiguous United States (CONUS), the FAA William J. Hughes Technical
  Center (WJHTC), and the FAA Academy.  The EBUS design employs the existing FAA-certified
  software of the Microprocessor En Route Automated Radar Tracking System (MEARTS)
  application to provide radar data processing (RDP) services for the replacement
  legacy backup system.  MEARTS provides key capabilities not supported by the DARC
  legacy system it replaces, among which are the safety functions of Conflict Alert
  (CA), Mode C Intruder (MCI), and Minimum Safe Altitude Warning (MSAW).  The EBUS
  also provides Next Generation Radar\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
